import React from "react";

export  class ToDoList extends React.Component{
    constructor(){
        super();
        this.state={
            nameList:[
                'Sanitha','Parvathy','Akshara','Soumya'
            ],input:''
        }
    }
    render(){
        return(

            <>
            <h2>TODOLIST</h2>
            <input type="text"/>
            <button>Add Names</button>
            {this.state.nameList.map((names,index)=><li key={index}>{names}</li>)}
            
            </>
        )
       
    }
}
